import { Container } from "./styles/styles.js";
import gitLogo from "./img/github.svg";
import Input from "./components/Input/index.jsx";
import ItemRepo from "./components/itemRepo/index.js";

const App = () => {
  return (
    <>
      <Container>
        <div className="App">
          <img src={gitLogo} width={72} height={72} />
        </div>
        <Input />
        <ItemRepo />
      </Container>
    </>
  );
};

export default App;
